import React from 'react';
import {NavLink} from 'react-router-dom';
import './Nav.css';
import 'bootstrap/dist/css/bootstrap.css';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

function Nav() {
    return (
      <>
       
        <div className='main bg-dark py-1 px-3 d-flex align-items-center justify-content-between'>
        
            <div className='logo px-3'>
                <img src="images/logomovie.png" alt="" />
            </div>
            <div className='menu px-3 d-flex justify-content-around'>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink exact activeClassName="active_class " className="menu-text text-light" to="/home.js" > Home</NavLink> </div>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink exact activeClassName="active_class " className="menu-text text-light" to="/about.js" > About</NavLink> </div>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink exact activeClassName="active_class " className="menu-text text-light" to="/contact.js" >Contact</NavLink> </div>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink exact activeClassName="active_class " className="menu-text text-light" to="/services.js" >Services</NavLink> </div>
            </div>
           
            <div className='d-flex justify-content-between align-items-center'>
                <input type="text" placeholder='Search' className='bg-dark px-3 py-2 rounded fs-16' />
                <AccountCircleIcon style={{color:"white",fontSize:"45px",}} className='px-2'></AccountCircleIcon>
            </div>
        </div>

      </>
    );
}

export default Nav;
